      var x = window.innerWidth;
      var y = window.innerHeight;
      div.style.paddingTop = -y;
      div.style.paddingLeft = -x;
      slideNo = slides.indexOf(e.target.id)+1;
      div.innerHTML = "<p id='slide-text'>"+slideNo+"</p>";
